import React from "react";
import "bootstrap/dist/css/bootstrap.min.css";
import Sidebar from "../components/sidebar";
import Card from "../components/card";
export default class Teaching extends React.Component {
  render() {
    return (
      <div className="container-fluid">
        <div className="row">
          <Sidebar />
          <div className="col-sm-9 whiteCarryover">
            <div className="row">
              <div className="card-deck">
                <div className="col-sm-6">
                  <Card
                    course="CS"
                    code="1110"
                    name="Computing using python"
                    positions="Mentor, Head of consulting hours, Teaching consultant"
                    duties="• Led 8 mentees and consulting hours, worked closely with 5 teaching faculty, conducted weekly labs and grading sessions for student help\n• Lectured and helped a class of 60 students, coordinated virtual consulting hours across various timezones during coronavirus pandemic.

                    "
                  />
                </div>
              </div>
            </div>
          </div>
        </div>
      </div>
    );
  }
}
